import { Navbar,Container,Nav } from 'react-bootstrap';
import { Link } from 'react-router-dom';

function NavBar() {
  return (
    <Navbar bg="light" variant="light">
      <Container>
        <Navbar.Brand href="#home">Aroyehun Segun | Full-Stack Developer</Navbar.Brand>
        <div id='navbar'>
        <Nav className="me-auto" >
          <Nav.Link href="#home" style={{color:'black', textDecoration:'underline' }}>Home</Nav.Link>
          <Nav.Link href="#features">About Me</Nav.Link>
          <Link to='portfolio'><Nav.Link href="portfolio">  Portfolio</Nav.Link></Link>
          <Nav.Link href="#pricing" style={{ border: '1px solid black', borderRadius: '20px', color:'black'}}>Contact Me</Nav.Link>
        </Nav>
        </div>
      </Container>
    </Navbar>
  );
}

export default NavBar;
